import Head from 'next/head';

const Layout = (props) => {
    return(
        <div>
            <Head>
                <title></title>
                <link rel="stylesheet" href="https://bootswatch.com/4/cosmo/bootstrap.min.css" />
            </Head>
            {props.children}
        </div>        
    );
}

export default Layout;
